import { MyContext } from '../../context';
import { useToast } from '@chakra-ui/core';

const Dashboard = ({history}) => {
    const context = useContext(MyContext)
    const toast = useToast()

    return (
        <MyContext.Consumer>
            {context => {
                return(
                    <>
                        <NavBar />
                    </>
                )
            }}
        </MyContext.Consumer>
    );
};

export default Dashboard;
